import React, { useState } from "react";
import { Row, Col, Container, Spinner } from "react-bootstrap";

import NavBar from "./NavBar";

const Dashboard = () => {
  return (
    <>
      <NavBar />
      <Container className="text-center dashboard" fluid></Container>
    </>
  );
};

export default Dashboard;
